import React, { useEffect, useState } from "react";
import EmployeeService from "../services/EmployeeService";
import { Link, useNavigate } from "react-router-dom";

export const CreateEmployeeComponent = () => {
  const [firstName, setFirstName] = useState("");
  const [middleName, setMiddleName] = useState("");
  const [lastName, setLastName] = useState("");
  const [locationCity, setLocationCity] = useState("");
  const [address, setAddress] = useState("");
  const [dateBirth, setDateBirth] = useState("");
  const [telephone, setTelephone] = useState("");
  const [status, setStatus] = useState("");
  const [positionTitle, setPositionTitle] = useState("");
  const [hireDate, setHireDate] = useState("");
  const [email, setEmail] = useState("");
  const [salary, setSalary] = useState("");
  const [timeInPosition, setTimeInPostion] = useState("");

  const navigate = useNavigate();

  this.changeFirstNameHandler = this.changeFirstNameHandler.bind(this);
  this.changeMiddleNameHandler = this.changeMiddleNameHandler.bind(this);
  this.changeLastNameHandler = this.changeLastNameHandler.bind(this);
  this.changeLocationCityHandler = this.changeLocationCityHandler.bind(this);
  this.changeAddressHandler = this.changeAddressHandler.bind(this);
  this.changeDateBirthHandler = this.changeDateBirthHandler.bind(this);
  this.changeTelephoneHandler = this.changeTelephoneHandler.bind(this);
  this.changePositionHandler = this.changePositionHandler.bind(this);
  this.changeDateArrivalHandler = this.changeDateArrivalHandler.bind(this);
  this.changeEmailHandler = this.changeEmailHandler.bind(this);
  this.changeSalaryHandler = this.changeSalaryHandler.bind(this);
  this.changeTimeSalaryHandler = this.changeTimeSalaryHandler.bind(this);
  this.changeStatusHandler = this.changeStatusHandler.bind(this);
  this.saveEmployee = this.saveEmployee.bind(this);

  const goToTest = (e) => {
    e.preventDefault();
    navigate("/employee");
  };

  changeFirstNameHandler = (event) => {
    this.setState({ firstName: event.target.value });
  };

  changeMiddleNameHandler = (event) => {
    this.setState({ middleName: event.target.value });
  };

  changeLastNameHandler = (event) => {
    this.setState({ lastName: event.target.value });
  };

  changeLocationCityHandler = (event) => {
    this.setState({ locationCity: event.target.value });
  };

  changeAddressHandler = (event) => {
    this.setState({ address: event.target.value });
  };

  changeDateBirthHandler = (event) => {
    this.setState({ dateBirth: event.target.value });
  };

  changeTelephoneHandler = (event) => {
    this.setState({ telephone: event.target.value });
  };

  changePositionHandler = (event) => {
    this.setState({ position: event.target.value });
  };

  changeDateArrivalHandler = (event) => {
    this.setState({ dateArrival: event.target.value });
  };

  changeEmailHandler = (event) => {
    this.setState({ email: event.target.value });
  };

  changeSalaryHandler = (event) => {
    this.setState({ salary: event.target.value });
  };

  changeTimeSalaryHandler = (event) => {
    this.setState({ timeSalary: event.target.value });
  };

  changeStatusHandler = (event) => {
    this.setState({ status: event.target.value });
  };

  saveEmployee = (e) => {
    e.preventDefault();
    let employee = {
      hireDate: this.state.dateArrival,
      positionTitle: this.state.position,
      email: this.state.email,
      salary: this.state.salary,
      timeSalary: this.state.timeSalary,
      state: this.state.status,
      idEmployee: {
        firstName: this.state.firstName,
        middleName: this.state.middleName,
        lastname: this.state.lastName,
        locationCity: this.state.locationCity,
        address: this.state.address,
        dateBirth: this.state.dateBirth,
        telephone: this.state.telephone,
      },
    };
    console.log("employee => " + JSON.stringify(employee));

    EmployeeService.createEmployee(employee).then((res) => {
      this.props.history.push("/employee");
    });
  };

  return (
    <div className="container">
      <div className="row">
        <div className="card col-md-6 offset-md-3 offset-md-3">
          <h3 className="text-center">Employee Form</h3>
          <div className="card-body">
            <form>
              <h5 className="text-center">Employee Data</h5>
              <div className="form-group">
                <label>First Name:</label>
                <input
                  placeholder="First Name"
                  name="firstName"
                  className="form-control"
                  value={this.state.firstName}
                  onChange={this.changeFirstNameHandler}
                />
              </div>
              <div className="form-group">
                <label>Middle Name:</label>
                <input
                  placeholder="Middle Name"
                  name="middleName"
                  className="form-control"
                  value={this.state.middleName}
                  onChange={this.changeMiddleNameHandler}
                />
              </div>
              <div className="form-group">
                <label>Last Name:</label>
                <input
                  placeholder="Last Name"
                  name="lastName"
                  className="form-control"
                  value={this.state.lastName}
                  onChange={this.changeLastNameHandler}
                />
              </div>
              <div className="form-group">
                <label>Location City:</label>
                <input
                  placeholder="Location City"
                  name="locationCity"
                  className="form-control"
                  value={this.state.locationCity}
                  onChange={this.changeLocationCityHandler}
                />
              </div>
              <div className="form-group">
                <label>Address:</label>
                <input
                  placeholder="Address"
                  name="address"
                  className="form-control"
                  value={this.state.address}
                  onChange={this.changeAddressHandler}
                />
              </div>
              <div className="form-group">
                <label>Date Birth:</label>
                <input
                  placeholder="Date Birth"
                  name="dateBirth"
                  className="form-control"
                  value={this.state.dateBirth}
                  onChange={this.changeDateBirthHandler}
                />
              </div>
              <div className="form-group">
                <label>Telephone:</label>
                <input
                  placeholder="Telephone"
                  name="telephone"
                  className="form-control"
                  value={this.state.telephone}
                  onChange={this.changeTelephoneHandler}
                />
              </div>

              <h5 className="text-center">Position Data</h5>
              <div className="form-group">
                <label>Position:</label>
                <input
                  placeholder="Position"
                  name="position"
                  className="form-control"
                  value={this.state.position}
                  onChange={this.changePositionHandler}
                />
              </div>
              <div className="form-group">
                <label>Date Arrival:</label>
                <input
                  placeholder="Date Arrival"
                  name="dateArrival"
                  className="form-control"
                  value={this.state.dateArrival}
                  onChange={this.changeDateArrivalHandler}
                />
              </div>
              <div className="form-group">
                <label>Email:</label>
                <input
                  placeholder="Email"
                  name="email"
                  className="form-control"
                  value={this.state.email}
                  onChange={this.changeEmailHandler}
                />
              </div>
              <div className="form-group">
                <label>Salary:</label>
                <input
                  placeholder="Salary"
                  name="salary"
                  className="form-control"
                  value={this.state.salary}
                  onChange={this.changeSalaryHandler}
                />
              </div>
              <div className="form-group">
                <label>Time Salary:</label>
                <input
                  placeholder="Time Salary"
                  name="timeSalary"
                  className="form-control"
                  value={this.state.timeSalary}
                  onChange={this.changeTimeSalaryHandler}
                />
              </div>
              <div className="form-group">
                <label>Status:</label>
                <input
                  placeholder="Status"
                  name="status"
                  className="form-control"
                  value={this.state.status}
                  onChange={this.changeStatusHandler}
                />
              </div>

